import React from "react";
import { Form,  Button, Input, Card, Icon , List } from "antd";

const Profile = () => {
  return (
    <div>
      <Form style={{ marginBottom: '20px', border: '1px solid #d9d9d9', padding: '20px'}} >
        <Input addonBefore="닉네임"></Input>
        <Button type="primary">수정</Button>
      </Form>
      <List stlye ={{ marginBottom : '20px'}}  grid={{ gutter :4, xs:2, md:3}}
        header={<div>팔로잉 목록</div>}
        size ="small"
        loadMore={<Button style={{width: '100%'}}></Button>}
        bordered
        dataSource={['제로초','바보','노드버드오피셜']}
        renderItem={item => (
          <List.Item style ={{ marginTop :'20px'}}>
            <Card actions={[<Icon type="stop"></Icon>]}> <Card.Meta description={item}></Card.Meta> </Card>
          </List.Item>
        )}
>
       

     </List>
     <List stlye ={{ marginBottom : '20px'}}  grid={{ gutter :4, xs:2, md:3}}
        header={<div>팔로워 목록</div>}
        loadMore={<Button style={{width: '100%'}}></Button>}
        bordered
        dataSource={['제로초','바보','노드버드오피셜']}
        renderItem={item => (
          <List.Item style ={{ marginTop :'20px'}}>
            <Card actions={[<Icon type="stop"></Icon>]}> <Card.Meta description={item}></Card.Meta> </Card>
          </List.Item>
        )}>
       


     </List>
    </div>
  );
};
export default Profile;
